];

// Tools and Practices
const toolsAndPracticesSkills = [
    { title: "Postman" },
    { title: "Git" },
    { title: "Github" },
    { title: "Linux" },
];

const Skill = () => {
    return (
        <Container
            id="intro"
            sx={{
                display: "flex",
                flexDirection: "column",
                alignItems: "center",
                justifyContent: "center",
                height: "100%",
            }}
        >
            <Typography variant="h2" fontWeight={"bold"} align="center" mb={10}>
                Skills
            </Typography>
        </Container>
    );
};


export default Skill;
